import React, {Component} from 'react';
import classes from './Dialogs.module.css';


const Dialogs = (props) => {
    return (
        <div className={classes.dialogs}>
            <div className={classes.dialogsItems}>
                <div className={classes.dialog + ' ' + classes.active}>Sasha</div>
                <div className={classes.dialog}>Kolechka</div>
                <div className={classes.dialog}>Andrey</div>
                <div className={classes.dialog}>Chekatilo</div>
                <div className={classes.dialog}>Vorobey</div>
            </div>
            <div className={classes.messages}>
                <div className={classes.message}>Hi</div>
                <div className={classes.message}>Byhai</div>
                <div className={classes.message}>How is your wife? </div>
            </div>
        </div>
    )
};

export default Dialogs;
